"use strict";
{
    // Basic Data Type
    // Primitive
    // 1. number
    let num = 2;
    // 2. string
    let name = "Nushrat Jahan";
    // 3. boolean
    let isStudent = true;
    // 4. null
    let nothing = null;
    // 5. undefined
    let notDefine = undefined;
    // Non-Primitive
    // 1. Array
    let friends = ["Nowrin", "Asha", "Tania", "Juthy"];
    let age = [25, 25, 24, 25];
    // 2. tuple
    let marks = ["Physics", 88, true];
    // 3. Object
    const user = {
        name: "Nushrat",
        institution: "Islamic University",
        isMarried: true,
    };
    // user.name = "Nowrin"; // cannot re-assign readonly
}
